==Cebuano==
===Alternative forms===
* {{alter|ceb|yawe}}
===Etymology===
From {{bor|ceb|es|llave||key}}, from {{der|ceb|la|clāvis||key}}. This and [[yawe]] seem to be more recent developments as they seem to be affected by [[w:Yeísmo|yeísmo]]. If the word was borrowed earlier, it might have been *''lyabe'' or *''liyabe''.
